import React from "react";

export default function Contact(){
    return(
        <section id="contact">
            <div>
                <iframe
                width="100%"
                height="100%"
                title="map"
                className="absolute insert-0"
                frameBorder={0}
                marginHeight={0}
                marginWidth={0}
                style={{filter:"opacity(0.7)"}}
                src="https://www.google.com/maps/place/Quinpool+Court/@44.6470782,-63.5996305,17z/data=!3m1!4b1!4m5!3m4!1s0x4b5a2180d1da35dd:0x9798acb92ede5452!8m2!3d44.6470533!4d-63.5975233?hl=en"/>
            </div>
        </section>
    )
}
